AsistenciaClase.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

contract CertificadoAsistencia {
    struct  Alumno {
      string nombreEst;
      string nombreCls;
      uint fechaParticipacion;
      bool asistio;
   }

    mapping (
    uint => Alumno) public alumnos; 

    constructor(string memory nombreE, string memory nombreC, uint codigoE, uint fechaP) {
        alumnos[codigoE].nombreEst = nombreE;
        alumnos[codigoE].nombreCls = nombreC;
        alumnos[codigoE].fechaParticipacion = fechaP;
        alumnos[codigoE].asistio = false;
    }

    function guardarCertificado(string memory nombreE, string memory nombreC, uint codigoE, uint fechaP) public {
        Alumno memory estudiante = Alumno(nombreE, nombreC, fechaP,true);
        alumnos[codigoE] = estudiante;
    }

    function cosultarCertificado(uint codigoE) public  view returns (bool) {
        return alumnos[codigoE].asistio;
    }
}

